import React, { Component } from 'react'
import './navigation.css';

import CategoryNature from './svg/nature.svg';
import CategoryIndustrial from './svg/industrial.svg';
import CategoryWaterside from './svg/waterside.svg';
import CategoryStreet from './svg/street.svg';
import CategoryNatureActive from './svg/nature-active.svg';
import CategoryIndustrialActive from './svg/industrial-active.svg';
import CategoryWatersideActive from './svg/waterside-active.svg';
import CategoryStreetActive from './svg/street-active.svg';

// const categoryNature = './svg/nature.svg';
// const categoryIndustrial = './svg/industrial.svg';
// const categoryWaterside = './svg/waterside.svg';
// const categoryStreet = './svg/street.svg';
// const categoryNatureActive = './svg/nature-active.svg';
// const categoryIndustrialActive = './svg/industrial-active.svg';
// const categoryWatersideActive = './svg/waterside-active.svg';
// const categoryStreetActive = './svg/street-active.svg';

let nature = CategoryNature;
let industrial = CategoryIndustrial;
let waterside = CategoryWaterside;
let street = CategoryStreet;


let activeId = 38;
let activeCategory = 0;

let category1 = [1,17,18,22,34,38,49,55,58,61,72];

// Categories

// const Category = props => {
//   let categoryClass = 'category category-unknown'; //navigation.css

//   if (props.active) {
//     categoryClass = 'category category-discovered';
//   }

//   return (
//     <div
//       className={categoryClass}
//       id={props.key}
//       key={props.key}
//       onClick={props.categorySelect}
//     > </div>
//   )
// }

// Circle

const FragmentCircle = props => {
  let circleClass = 'circle circle-unknown'; //navigation.css

  if (props.discovered) {
    circleClass = 'circle circle-discovered';
  }
  if (props.active) {
    circleClass = 'circle circle-active';
  }

  if (props.highlighted) {
    circleClass += ' circle-highlighted';
  }

  return (
    <div
      className={circleClass}
      id={props.key}
      key={props.key}
      onClick={props.handleClick}
    />
  )
}

// Deault matrix

const buildMatrixState = (rowCount, rowLength) => {
  const totalCircles = rowCount * rowLength;
  const matrixState = {};

  // Calculate details for each circle
  for (let key = 1; key <= totalCircles; key++) {
    const circleDetails = {
      active: false,
      discovered: false,
      highlighted: false
    };

    matrixState[key] = circleDetails;
  }
  matrixState[activeId].active = true;

  return matrixState;
}

// Class

class Navigation extends Component {
  constructor(props) {
    super(props)
    const initialRowCount = 15;
    const initialRowLength = 5;

    this.state = {
      rowCount: initialRowCount,
      rowLength: initialRowLength,
      matrix: buildMatrixState(initialRowCount, initialRowLength)
    };

    this.handleClick = this.handleClick.bind(this);
  }

  categoryHover(index) {
    if (index === 1) {
      nature = CategoryNatureActive;
    } else if (index === 2) {
      industrial = CategoryIndustrialActive;
    }
  }

  categorySelect(index) {
    let matrix = this.state.matrix;
    if (index === 0) {
      for (let key = 1; key <= 75; key++) {
        matrix[key].highlighted = false;
      }
    } else if (index === 1) {
      for (let key = 0; key < category1.length; key++) {
        matrix[category1[key]].highlighted = true;
      }
    }
  }

  handleClick(e) {
    const matrix = this.state.matrix;
    const id = e.target.id;

    matrix[id].active = true;
    matrix[activeId].active = false;
    matrix[activeId].discovered = true;

    this.setState({ matrix });
    activeId = id;
    this.props.handleIdChange(id);
  }

  rowBuilder(rowCount, rowLength, rows = []) {
    this.categorySelect(1);
    if (rowCount > 0) {
      const circleKey = rowCount * rowLength;
      rows.push(this.circleBuilder(circleKey, rowCount, rowLength));

      return this.rowBuilder(rowCount - 1, rowLength, rows);
    }
    return rows
  }

  circleBuilder(circleKey, rowCount, rowLength, row = []) {
    if (rowLength > 0) {
      const circle = this.state.matrix[circleKey];

      row.push(FragmentCircle({
        key: circleKey,
        active: circle.active,
        discovered: circle.discovered,
        highlighted: circle.highlighted,
        handleClick: this.handleClick,
      }));

      return this.circleBuilder(circleKey - 1, rowCount, rowLength - 1, row);
    }
    return (<div key={'row-' + rowCount}>{row}</div>);
  }

  render() {
    return (
      <div>
        <div className="navigation">
          {this.rowBuilder(this.state.rowCount, this.state.rowLength)}
        </div>
        <div className="cats">
          <div src={nature} className="category" onMouseOver={this.categoryHover(1)} onClick={this.categorySelect(1)} />
          <img src={industrial} className="category" onMouseOver={this.categoryHover(2)} onClick={this.categorySelect(1)} />
          <img src={waterside} className="category" onMouseOver={this.categoryHover(3)} onClick={this.categorySelect(1)} />
          <img src={street} className="category" onMouseOver={this.categoryHover(4)} onClick={this.categorySelect(0)} />
        </div>
      </div>
    )
  }
}

export default Navigation;
